import React from 'react';
import RickAndMortyCharacterCard from './Components/RickAndMortyCharacterCard';
import './App.css'; // Importar estilos de App

function App() {
  const characterIds = [1, 2, 3, 10]; // IDs de los personajes que deseas mostrar

  return (
    <div className="app-container">
      <h1 className="app-title">Personajes de Rick and Morty</h1>
      <RickAndMortyCharacterCard ids={characterIds} />
    </div>
  );
}

export default App;
